const getHasAccess = (player) => {
  if(!player.wallet){
    console.log('player is anonymous')  
    return Promise.resolve(false)
  }

  return Promise.all([
      getHasWearable(player, 1, 277), 
      getHasWearable(player, 1, 472)
    ]).then(hasWearable => {
    console.log({ hasWearable });
    return hasWearable.find(Boolean)
  })  
}

const getHasWearable = (player, wearable_id, collection_id) => {
  var url = "https://www.cryptovoxels.com/api/avatars/" + player.wallet + ".json?nonce=" + new Date().getTime()
  return fetch(url).then(r => r.json()).then((data) => {
    try {
      return !!data.avatar.costume.attachments.find(a => a.wearable_id == wearable_id && a.collection_id == collection_id)
    } catch (e) {
      return false
    }
  }).catch(e => false)
}

const toggleDoor = (player, fromOutside) => {
  getHasAccess(player).then(hasAccess => {
    if (fromOutside) {
      if (!hasAccess) {
        doorSign.set({ text: 'Access denied - Must wear headphones to enter' });
        return;    
      }
      if (closed) {
        doorSign.set({ text: 'Access granted - Welcome to the EulerClub!' });        
        openDoor();
      } else {
        closeDoor();
      }
    } else {
      if (closed) {
        openDoor();
        if (!fromOutside) {
          setTimeout(()=> { closeDoor() } , 3000)
        }    
      } else {
        closeDoor();
      }
    } 
    updateSoundtrack(fromOutside)
  })
}


doorButton.on('click', e => {
