let claiming = false;
button.on('click', (e) => {
  console.log(e);
  if (claiming) {
    return;
  }
  if (e.player.isAnonymous) {
    sign.set({ url: RESPONSE_IMAGES.noLogin });
    return;
  }
  claiming = true;
  sign.set({ url: RESPONSE_IMAGES.loading });
  try {
    fetch('https://api2.eulerbeats.com/v2/claim', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({
        item: 'white-headphones',
        address: e.player.wallet,
      }),
    })
    .catch((error) => {
      sign.set({ url: RESPONSE_IMAGES.error });
      claiming = false;
    })
    .then(response => {
      console.log(response);
      return response.json()
    })
    .catch((error) => {
      sign.set({ url: RESPONSE_IMAGES.error });
      claiming = false;
    })
    .then(data => {
      if (data.error) {
        setTimeout(() => {
          if (data.code === RESPONSE_CODES.noClaim) {
            sign.set({ url: RESPONSE_IMAGES.noClaim });
          } else if (data.code === RESPONSE_CODES.alreadyClaimed) {
            sign.set({ url: RESPONSE_IMAGES.alreadyClaimed });
          } else {
            sign.set({ url: RESPONSE_IMAGES.error });
          }
        }, 6000)
        animateClaw(false);
      } else {
        setTimeout(() => {
          sign.set({ url: RESPONSE_IMAGES.success });
        }, 6000)
        animateClaw(true);
      }
      setTimeout(() => {
        claiming = false;
      }, 6000) // animation duration
    })
    .catch((error) => {
      sign.set({ url: RESPONSE_IMAGES.error });
      claiming = false;
    })
  } catch(error) {
    sign.set({ url: RESPONSE_IMAGES.error });
    claiming = false;
  }
});
